properties.height_policy:
(1)	Tinggi suatu bangunan pada suatu jalan tidak boleh melebihi 1,50 (satu koma lima puluh) x jarak antara garis-garis sempadan bangunan yang berhadapan pada jalan yang bersangkutan kecuali bila ditentukan lain dalam RDTRK.
(2)	Dalam mengukur tinggi bangunan tidak diperhitungkan ruang perlengkapan alat-alat, perlengkapan dekoratif, parapet yang tingginya tidak melebihi 1 (satu) meter, tiang antena dan:
a.	yang lebarnya tidak melebihi ¼ (satu per empat) lebar permukaan bangunan kecuali parapet;
b.	tidak disediakan akomodasi dalam bentuk dan waktu apapun;
c.	tidak dipergunakan untuk maksud-maksud advertensi;
d.	tidak menghalangi sudut cahaya yang dibutuhkan oleh jendela-jendela pada bangunan tersebut.
(3)	Bangunan tipe I dan tipe II (konstruksi rangka tahan api/konstruksi dinding pemikul yang terlindung):
a.	untuk bangunan tipe I berlaku ketentuan sebagaimana dimaksud pada ayat (1);
b.	untuk bangunan tipe II tinggi bangunan tidak diperkenankan melebihi 17/20 (tujuh belas per dua puluh) atau 85% (delapan puluh lima persen) tinggi maksimum yang ditentukan sebagaimana dimaksud pada ayat (1);
c.	untuk konstruksi campuran tinggi maksimum dari satu bangunan diambil tinggi maksimum dari tipe konstruksi yang lebih rendah.
(4)	Tinggi bangunan tipe III, tipe IV dan tipe V tidak diperkenankan melebihi 2/3 (dua per tiga) dari tinggi maksimum yang ditentukan sebagaimana dimaksud pada ayat (1), dan tidak diperkenankan mempunyai lapisan lantai lebih dari:
a.	bangunan tipe III dengan penggunaan kelas 1, kelas 2, kelas 3, kelas 4, kelas 5, kelas 6, kelas 7, kelas 8, dan kelas 9, jumlah tingkat maksimum 2 (dua);
b.	bangunan tipe IV dengan penggunaan kelas 7 dan kelas 8 jumlah tingkat maksimum 1 (satu);
c.	bangunan tipe V dengan penggunaan kelas 1 dan kelas 2, jumlah tingkat maksimum 2 (dua) dengan penggunaan kelas 8 (ijin khusus dari Walikota) jumlah tingkat maksimum 1 (satu).
(5)	Jumlah tingkat sebagaimana dimaksud pada ayat (4) huruf a, tidak termasuk ruang di bawah tanah (basement) yang tingginya diukur dari permukaan halaman tidak melebihi 1 (satu) meter.
(6)	Tinggi bangunan masing-masing tipe sebagaimana dimaksud pada ayat (4), lantai tingkat yang tinggi-tingginya melebihi 5 (lima) meter pada penggunaan tiap-tiap kelas, kecuali bangunan kelas 8 dan kelas 9 diperhitungkan sebagai dua tingkat.
(7)	Tinggi bangunan pada lokasi di jalan yang memiliki garis sempadan bangunan sama dengan 0 (nol) ketentuannya diberlakukan sama dengan ketentuan sebagaimana dimaksud pada ayat (1), ayat (2), ayat (3) dan ayat (4), dikalikan dengan ½ (setengah) lebar rumija ditambah 1 (satu).

